import clsx from 'clsx';
import styles from './TableForm.module.scss'
import { useState } from 'react';


const TableForm = () => {
  const [status, setStatus] = useState('');
  const [peopleMax, setPeopleMax] = useState('');
  const [peopleSitting, setPeopleSitting] = useState('');
  const [bill, setBill] = useState('');

  return (
    <div className="container">
      <div >
        <h3 className="mt-4 pt-4">Status:</h3>
        <select onChange={e => setStatus(e.target.value)}>
          {status}
        </select>
      </div>

      <div>
        <h3 className="mt-4 pt-4">People:</h3>
        <input type="number" onChange={e =>
          setPeopleSitting(e.target.value)}>{peopleSitting}</input><span>/</span><input type="number" onChange={e =>
            setPeopleMax(e.target.value)}>{peopleMax}</input>
      </div>

      <div>
        <h3 className="mt-4 pt-4">Bill:</h3>
        <span>$</span><input type="number" onChange={e =>
          setBill(e.target.value)}>{bill}</input>
      </div>

      <button className={clsx("btn-default btn-lg mt-4", styles.mybtn)}>Update</button>


    </div >
  )

}

export default TableForm;
